import React from 'react';
import Body from '../Body';
import Sidebar from '../Sidebar';
import "./style.css"

const Player = () => {
    return (
        <div className='body'>
            <Sidebar></Sidebar>
            <Body></Body>
        </div>
    );
};

export default Player;
